resident using trash cans to block street side curb. two way traffice unable to pass without stopping.

8-1571.‚ÄÉStopping, standing or parking prohibited in specified places.¬†(a) Except when necessary to avoid conflict with other traffic, or in compliance with law or the directions of a police officer or official traffic-control device, no person shall:

(1)‚ÄÉStop, stand or park a vehicle:

(i)‚ÄÉOn the roadway side of any vehicle stopped or parked at the edge or curb of a street;

(ii)‚ÄÉOn a sidewalk;

(iii)‚ÄÉWithin an intersection;

(iv)‚ÄÉOn a crosswalk;

(v)‚ÄÉBetween a safety zone and the adjacent curb or within thirty (30) feet of points on the curb immediately opposite the ends of a safety zone, unless a different length is indicated by signs or markings;

(vi)‚ÄÉAlongside or opposite any street excavation or obstruction when stopping, standing or parking would obstruct traffic;

(vii)‚ÄÉUpon any bridge or other elevated structure upon a highway or within a highway tunnel;

(viii)‚ÄÉOn any railroad tracks;

(ix)‚ÄÉOn any controlled-access highway;

(x)‚ÄÉIn the area between roadways of a divided highway, including crossovers; or

(xi)‚ÄÉAt any place where official signs prohibit stopping.

(2)‚ÄÉStand or park a vehicle, whether occupied or not, except momentarily to pick up or discharge a passenger or passengers:

(i)‚ÄÉIn front of a public or private driveway;

(ii)‚ÄÉWithin fifteen (15) feet of a fire hydrant;

(iii)‚ÄÉWithin twenty (20) feet of a crosswalk at an intersection;

(iv)‚ÄÉWithin thirty (30) feet upon the approach to any flashing signal, stop sign, yield sign or traffic-control signal located at the side of a roadway;

(v)‚ÄÉWithin twenty (20) feet of the driveway entrance to any fire station and on the side of a street opposite the entrance to any fire station within seventy-five (75) feet of said entrance, when properly signposted; or

(vi)‚ÄÉAt any place where official signs prohibit standing.

(3)‚ÄÉPark a vehicle, whether occupied or not, except temporarily for the purpose of and while actually engaged in loading or unloading property or passengers:

(i)‚ÄÉWithin fifty (50) feet of the nearest rail of a railroad crossing; or

(ii)‚ÄÉAt any place where official signs prohibit parking.

(b)‚ÄÉNo person shall move a vehicle not lawfully under his or her control into any such prohibited area or away from a curb such a distance as is unlawful.

History:‚ÄÉL. 1974, ch. 33, ¬ß 8-1571; July 1.

